import React from "react";
import AgentForm from "../Forms/AgentForm";
import ComplexForm from "../Forms/ComplexForm";
import PackageForm from "../Forms/PackageForm";
import PromotionForm from "../Forms/PromotionForm";

const MultiForm: React.FC<{ buttonName: string, type: "agent" | "complex" | "package" | "promotion", isDisabled: boolean}> = (props) => {
  let form;

  if(props.type === "agent"){
    form = (
      <AgentForm name={props.buttonName} isDisabled={props.isDisabled}/>
    );
  }else if (props.type === "complex"){
    form = (
    <ComplexForm name={props.buttonName} />
    );
  }else if (props.type === "package"){
    form = (
      <PackageForm name={props.buttonName} />
    );
  }else{
    form = (
      <PromotionForm name={props.buttonName} />
    );
  }

  return (
    <>
    {form}
    </>
  );
};

export default MultiForm;
